import './App.css';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom"; 
import MedRecordsStartPage from './Components/Pages/MedRecordsStartPage';
import ViewMedicalRecords from './Components/Pages/viewMedicalRecords';


function App() {
  return (
      <>
          <Router>
              <div>


                <Link to="/MedRecordsStartPage"> Start </Link>




              </div>


              <Routes>
                  <Route path="/" element={<MedRecordsStartPage />} />
                 {/* <Route path="/MedRecordsStartPage" element={<MedRecordsStartPage />} exact />*/}
                  <Route path="/ViewMedicalRecords" element={<ViewMedicalRecords/>} exact/>
              </Routes>

          </Router> 
      </>
  );
}

export default App;
